import {createMuiTheme} from "@material-ui/core/styles";


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: [
            "Roboto, Arial",
            '"Bebas Neue"'
    ]
    },
    palette: {
        primary: {
            main: "##F5EB00",

        },
        secondary: {
            main: "#650CF5",
        },
        background:{
            default: "#ffff"
        },
        info: {
            main: "#F5EB00"
        }
    },
    shape: {
        borderRadius: 10
    }
    
});

export default theme;
